<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Body Composition Calculator</title>
    <link href="https://cdn.jsdelivr.net/npm/tailwindcss@2.2.19/dist/tailwind.min.css" rel="stylesheet">
</head>
<body class="bg-gray-100 flex items-center justify-center h-screen">
    <div class="bg-white p-8 rounded shadow-md md:w-96 w-full">
        <h1 class="text-2xl font-bold mb-6 text-center">Body Composition Calculator</h1>
        <form id="bodyCompositionForm" class="space-y-4">
            <div>
                <label for="age" class="block text-gray-700">Age</label>
                <input type="number" id="age" class="w-full p-2 border border-gray-300 rounded mt-1" required>
            </div>
            <div>
                <label for="bodyWeight" class="block text-gray-700">Body Weight (kg)</label>
                <input type="number" id="bodyWeight" class="w-full p-2 border border-gray-300 rounded mt-1" required>
            </div>
            <!-- Image inserted here -->
            <div class="w-full flex justify-center">
                <img src="sf.jpg" alt="skinfold measurement" class="w-full" style="max-width: 100%;">
            </div>
            <!-- Image ends here -->
            <div>
                <label for="biceps" class="block text-gray-700 md-3">Everything should be measured as shown in above image</label>
                <label for="biceps" class="block text-gray-700">Biceps (mm) (Front of biceps)</label>
                <input type="number" id="biceps" class="w-full p-2 border border-gray-300 rounded mt-1" required>
            </div>
            <div>
                <label for="triceps" class="block text-gray-700">Triceps (mm) (Back of your arm)</label>
                <input type="number" id="triceps" class="w-full p-2 border border-gray-300 rounded mt-1" required>
            </div>
            <div>
                <label for="subscapular" class="block text-gray-700">Subscapular (mm) (At your back)</label>
                <input type="number" id="subscapular" class="w-full p-2 border border-gray-300 rounded mt-1" required>
            </div>
            <div>
                <label for="suprailiac" class="block text-gray-700">Suprailiac (mm) (near belly buttton)</label>
                <input type="number" id="suprailiac" class="w-full p-2 border border-gray-300 rounded mt-1" required>
            </div>
            <button type="button" onclick="calculateBodyComposition()" class="w-full bg-blue-500 text-white p-2 rounded hover:bg-blue-600">Calculate</button>
        </form>
        <div id="result" class="mt-4 text-left"></div>
    </div>
